For those who say the NBA bubble was a “fluke” have no idea what athletes went through being stuck in one place for nearly 100 days and for most, it was one of the hardest experiences they ever had to go through. 

3x NBA champion Danny Green lived it and went on to win a championship with the Los Angeles Lakers. 

